import React from 'react'
import styled from "styled-components"

const Wrapper = styled.div`
  min-height:80vh;
  background-color:#24305e;
`
export default function PreviousPlaylists() {
    return (
        <Wrapper>
            Previous Playlists go here
        </Wrapper>
    )
}
